import React from "react";
import { View, Text, StyleSheet } from "react-native";

const PageA = () => {
  return (
    <View style={styles.container}>
      <Text>This is Page 1</Text>
    </View>
  );
};

export default PageA;

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#fff",
  },
});
